  false,\n\t\"url\": null,\n\t\"notes\": \"The Chautauqua National Wildlife Refuge
  Sport Fishing Plans covers the assesment and managment strategies for sport fishing
  in the Refuge. Focus is on bass, crappie, bluegill and perch. Also discusses the
  degradation of lake quality due to siltation, and the relationship to sport fishing.
  Also discusses how sport fishing as population control for catfish and bullhead.
  Sport fishing is affected during waterfowl migration periods, as the main objectives
  for the Refuge are for waterfowl.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
